import { createSlice } from '@reduxjs/toolkit';
import { NameSpace } from '../../consts';
import { QuestsProcess } from '../../types/state';

const initialState: QuestsProcess = {
  pageCurrent: '1',
  priceFilterMin: 0,
  priceFilterMax: 0,
};

export const guitarsProcess = createSlice({
  name: NameSpace.Process,
  initialState,
  reducers: {
    choosePage: (state, action) => {
      state.pageCurrent = action.payload;
    },
    updatePriceFilterMin: (state, action) => {
      state.priceFilterMin = action.payload;
      // eslint-disable-next-line no-console
      console.log('state.priceFilterMin');
      // eslint-disable-next-line no-console
      console.log(state.priceFilterMin);
    },
    updatePriceFilterMax: (state, action) => {
      state.priceFilterMax = action.payload;
      // eslint-disable-next-line no-console
      console.log('state.priceFilterMax');
      // eslint-disable-next-line no-console
      console.log(state.priceFilterMax);
    },
  },
});

export const { choosePage, updatePriceFilterMin, updatePriceFilterMax } = guitarsProcess.actions;
